import React from 'react';
import { useState } from 'react';
import LoaderHeading from './util/LoaderHeading';
import ExamCard from './util/ExamCard';
import PageNavigateButton from './util/PageNavigateButton';

function ViewExams() {

    const [fetchedData, setFetchedData] = useState([]);
    const [pages, setPages] = useState([]);

    async function getData(url) {
        const response = await fetch(url, {
            method: 'GET'
        });
        return response.json(); 
    }



    const loadExams = () => {
        let URL = 'http://localhost:8080/UploadToS3/admins?page=';
        let pageElement = document.getElementsByName('pageNumber')[0];
        let currentPageNumber = 1;
        if(pageElement)
            currentPageNumber = pageElement.value;
        console.log(currentPageNumber);
        let entityPerPage = 2;
        getData(URL)
        .then(data => {
            console.log(data);
            setFetchedData(data.data);
            console.log(fetchedData);
            let totalPagesAvailable = Math.ceil(data.count/entityPerPage);
            let pagesButton = [];
            for(let i=0; i<totalPagesAvailable; i++) {
                pagesButton.push(i+1);
            }
            setPages(pagesButton);
        });
    }

    return (
    <>
        <LoaderHeading 
            description='Exams'
        />
        <div className='content-loaded'>
            <div>
                <button onClick={loadExams}>Fetch</button>
                <div>
                    {

                        fetchedData.map((d, key) => {
                            return <ExamCard 
                                key={key}
                                firstName={d.firstName}
                                lastName={d.lastName}
                                email={d.email}
                                contact={d.contact}
                            />
                        })
                    }
                </div>
                <div className='page-navigate-btn-container'>
                    {
                        pages.map((d, key) => {
                            return <PageNavigateButton
                                key={key}
                                number={d}
                                onclick={loadExams}
                            />
                        })
                    }
                </div>
            </div>
        </div>
    </>
    );
}

export default ViewExams;
